@import url("https://fonts.googleapis.com/css?family=Lato&display=swap");
body {
  margin: 0px auto;
  padding: 0px;
  background: #edf0f5;
  font-family: "Ubuntu", sans-serif;
  header {
    background: #3b5896;
    display: flex;
    color: white;
    height: 82px;
    div {
      display: flex;
      margin: 0px auto;
      width: 980px;
      a {
        h1 {
          margin: 25px 0px 15px 0px;
        }
        justify-content: flex-end;
        text-decoration: none;
        font-size: 20px;
        color: white;
      }
      div {
        width: 392px;
        padding-left: 450px;
        margin: auto 0px;
        div {
          display: flex;
          flex-direction: column;
          justify-content: space-evenly;
          padding: 2px;
          margin: 0px;
          input {
            border: 1px solid black;
            width: 150px;
            height: 20px;
          }
          a {
            font-size: 12px;
          }
          p {
            margin: 0px;
            font-size: 12px;
          }
        }
        a {
          font-size: 12px;
        }
      }
    }
  }
  // header
  // section
  section {
    display: flex;
    height: 607px;
    width: 980px;
    background: #edf0f5;
    margin: 0 auto;
    display: flex;
    .about {
      width: 565px;
      h2 {
        padding: 42px 0 24px;
        font-size: 28px;
        line-height: 36px;
        width: 400px;
      }
      div {
        display: flex;
        padding: 0px 0px 10px;
        margin-top: 14px;
        font-size: 14px;
        font-family: "Lato", sans-serif;
        img {
          padding-right: 15px;
        }
      }
    }
    .form {
      width: 399px;
      h1 {
        font-size: 36px;
        margin-bottom: 5px;
      }
      h3 {
        font-size: 19px;
        font-family: "Lato", sans-serif;
        padding: 0px;
        margin-top: 0px;
      }
      .together {
        display: flex;
        input {
          border: 1px solid whitesmoke;
          padding: 8px 10px;
          font-size: 18px;
          width: 188px;
          border-radius: 2px;
          border: 1px solid rgb(177, 177, 177);
        }
      }
      input {
        border: 1px solid whitesmoke;
        padding: 8px 10px;
        margin: 3px 0px;
        width: 100%;
        border: 1px solid rgb(177, 177, 177);
        font-size: 18px;
        border-radius: 2px;
      }
      form {
        h3 {
          font-size: 16px;
          color: #90949c;
          padding: 0px;
          margin: 15px 0px 10px;
        }
        select {
          font-size: 13px;
          height: 30px;
          padding: 5px;
          background: white;
          border: 1px solid rgb(177, 177, 177);
        }
        span {
          display: flex;
          justify-content: flex-start;
          span {
            display: flex;
            padding: 0px 10px;
            input {
              width: 20px;
            }
          }
        }
        button {
          font-size: 19px;
          color: white;
          background: linear-gradient(#67ae55, #578843);

          padding-bottom: 5px;
          background: linear-gradient(#67ae55, #578843);
          background-color: #69a74e;
          box-shadow: inset 0 1px 1px #a4e388;
          border: 1px solid;
          border-radius: 5px;
          color: #fff;
          cursor: pointer;
          margin-top: 10px;
          min-width: 194px;
          padding: 7px 20px;
          text-align: center;
          margin-bottom: 10px;
          display: inline-block;
          border-color: #3b6e22 #3b6e22;
        }
        p {
          font-size: 11px;
          width: 325px;
          color: #777;
        }
      }
      h4 {
        border-top: 2px solid #dddfe2;
        color: #666;
        font-size: 13px;
        font-weight: bold;
        margin-top: 10px;
        padding-top: 15px;
      }
    }
  }
  // section
  //footer
  footer {
    background: white;
    color:#737373;
    font-size: 12px;
    padding-bottom: 18vh;
    div {
      display: flex;
      width: 980px;
      margin: 0px auto;
      padding: 30px 0px;
      flex-direction: column;
      ul{
        list-style: none;
        display: flex;
        padding: 0px;
        margin-bottom: 1px;
        li {
            padding-right:10px;
            a{
                color: #385898;
                text-decoration: none;
            }
        }
      }
      .links {
        border-top: 1px solid #dddfe2;
      }
    }
  }
}
.fixfirst {
  padding-bottom: 15px;
}
.login {
  border: 1px solid #15294d;
  border-radius: 2px;
  margin: auto 0px;
  width: 110px;
  height: 20px;
  padding: 2px 2px;
  color: white;
  background: #32589b;
}
